    data: |
      SELECT DISTINCT + col0 * + col2 - col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col0 + + 92 <= + - col0;
  - name: tab1

outputs:
  - name: q11340.out
    data: |
      4882
      5010
      6141
